import React, { Component } from 'react';
import GradeEntryTable from './GradeEntryTable';

class GradeEntryBox extends Component {
    render() {
        return (
            <div className="jumbotron p-3 m-3 shadow">
                <h4>Grade Entry</h4>
                  <button type="button" className="btn btn-primary" data-toggle="modal" data-target="#gradeEntry">
                        Launch modal
                  </button>
                  <GradeEntryTable />
            </div>
        );
    }
}

export default GradeEntryBox;
